import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Navbar } from "react-bootstrap";

const style = {
    padding: '10px',
    color: '#050C0E',
    marginTop: '10px',
}

class App extends Component {
    render() {
        return (
            <div className="App container">
                <Navbar style={style}>
                    <Navbar.Header>
                        <Navbar.Brand>
                            <Link to="/" style={{ color: '#6bc4ff', font: '50'}}>
                                Mcgugin Dining Center Menu
                            </Link>
                        </Navbar.Brand>
                        <Navbar.Toggle />
                    </Navbar.Header>
                </Navbar>
            </div>
        );
    }
}

export default App;
